        return count;
    }

    // function which has nothing to do with the blockchain data
    function temp() public pure returns (uint){
        return 2+43;
    } 

    function increment() public{
        uint one = 1;
        count = count + one;
    }

    function decrement() public{
        count--;
    }

}

